import base64
import numpy as np
import cv2

# Your Base64 string (Replace with actual base64-encoded image data)
base64_string = ""

# Step 1: Fix padding if necessary
missing_padding = len(base64_string) % 4
if missing_padding != 0:
    base64_string += '=' * (4 - missing_padding)

# Step 2: Decode the Base64 string
img_data = base64.b64decode(base64_string)

# Step 3: Convert the bytes data to a numpy array
nparr = np.frombuffer(img_data, np.uint8)

# Step 4: Decode the numpy array to an image using OpenCV
img_np = cv2.imdecode(nparr, cv2.IMREAD_COLOR)

# Now img_np is a numpy array that represents the image
print(type(img_np))  # Should print: <class 'numpy.ndarray'>
print(img_np)  # Should print: (height, width, channels)

# Optionally, display the image using OpenCV
cv2.imshow("Image", img_np)
cv2.waitKey(0)
cv2.destroyAllWindows()
